const applicationFormPopUp=()=>{const o=$(".applicationFormPopUp"),p="applicationFormPopUp_active";$(".travel-order__button, .travel-order__button-550px").on("click",()=>{o.eq(0).addClass(p),$(".overflow").addClass("popUp__shadow"),$("body").addClass("popUp__Lock")}),$(".applicationFormPopUp__closeIcon").on("click",()=>{o.removeClass(p),$(".overflow").removeClass("popUp__shadow"),$("body").removeClass("popUp__Lock")}),$(document).mouseup(()=>{0==$(event.target).closest(o).length&&(o.removeClass(p),$(".overflow").removeClass("popUp__shadow"),$("body").removeClass("popUp__Lock"))})};applicationFormPopUp();